export const GetCustomIcon = ({ icon }) => {
  const trimmedIcon = icon && typeof icon === "string" ? icon.trim() : "";

  switch (trimmedIcon) {
    case "saveIcon":
      return <SaveIcon />;
    case "StarIcon":
      return <StarIcon />;
    default:
      return <SaveIcon />;
  }
};

